            body {
                background-color: #20323D;

            .NfElV,
            .izkFY {
                animation: NfElVA 5s ease-in-out infinite;
                transform: translateY(17%);
            }

            .inAsb {
                animation: inAsbA 5s ease-in-out infinite;
            }

            @keyframes inAsbA {
                from {
                    transform-origin: 00% 100%;
                    transform: scale(1.0);
                    -ms-transform: scale(1.0);
                    -webkit-transform: scale(1.0);
                }

                50% {

                    transform-origin: 00% 100%;
                    transform: scale(1.5);
                    -ms-transform: scale(1.5);
                    -webkit-transform: scale(1.5);
                }

                to {
                    transform-origin: 00% 100%;
                    transform: scale(1.0);
                    -ms-transform: scale(1.0);
                    -webkit-transform: scale(1.0);
                }
            }

            @keyframes NfElVA {
                from {
                    transform: translateY(17%);
                    opacity: 0;

                }

                25% {
                    opacity: 1;
                }

                50% {
                    transform: translateY(0%);
                    opacity: 1;
                }

                75% {
                    opacity: 1;
                }

                to {
                    transform: translateY(17%);
                    opacity: 0;

                }
            }
        </style>
